description:
Second Trauma

CG animation, raytraced

Mikaela was totally owned by Jenny in their last fight, but she&amp;#039;s more prepared now. She give the much bigger Jenny two body punches that she at least think might hurt her. Jenny counters with a heavy side belly punch that would almost invariably knock out a girl of Mikaela&amp;#039;s size. But Mikaela keep up, and after grasping some air, she attack Jenny with a choke hold. Jenny thwarts the strangulation with a powerful bear hug. Mikaela is stunned by the pain and Jenny can easily beat her down with belly punches and powerful kicks. She finally defeat the short girl with the Traumatizer submission hold.
